import React, { Component } from 'react'

export default class Hlogin extends Component {
    render() {
        return (
            <div>
                <header id='Header'>
                    <div></div>
                    <div id='log'>
                        <img src='/img/usuario50.jpg' alt='' />LOGIN
                    </div>
                    <div id='fecha' >
                        <input id="fechas" type="date" className='form-control' value="2022-01-31"></input>
                    </div>
                </header>
                
            </div>
        )
    }
}
